import groovy.json.JsonSlurper
import groovy.json.JsonOutput
import java.nio.charset.StandardCharsets
import org.apache.nifi.processor.io.StreamCallback

// 1. 获取 FlowFile，如果队列为空则返回
def flowFile = session.get()
if (!flowFile) {
    return
}

try {
    // 2. 使用 read 和 write 回调函数来高效地处理内容
    flowFile = session.write(flowFile, { inputStream, outputStream ->
        // 3. 解析输入的JSON数据
        // 将输入流解析为Groovy对象（这里是一个Map列表）
        def data = new JsonSlurper().parse(inputStream)

        // 4. 核心处理逻辑：遍历每条记录
        data.each { record ->
            // 判断 'Donor Gender' 字段是否为 "Female" 或 "Male"（区分大小写）
            if (record['original_Donor Gender'] == 'Female' || record['original_Donor Gender'] == 'Male' || record['original_Donor Gender'] == 'Unclassified') {
                // 合法，添加标记字段
                // record.gender_valid = true
            } else {
                // 不合法，添加标记字段
                record._validations = ['Donor Gender': 'Donor Gender must be Female or Male or Unclassified']
            }
        }

        // 5. 将修改后的Groovy对象转换回JSON字符串，并写入输出流
        def newJson = JsonOutput.toJson(data)
        outputStream.write(newJson.getBytes(StandardCharsets.UTF_8))
    } as StreamCallback)

    // 6. 将处理成功的 FlowFile 传输到 "success" 关系
    session.transfer(flowFile, REL_SUCCESS)

} catch (e) {
    // 7. 如果在任何步骤（如JSON解析）发生错误，则记录日志并转移到 "failure"
    log.error("处理JSON内容失败 for FlowFile {}: {}", [flowFile, e.message], e)
    session.transfer(flowFile, REL_FAILURE)
}
